import React from 'react';
import 'Tachyons';

const ProfessionalPlayersList = (props) =>{
	return(
		<div className="bg-light-green dib br3">
			<h2>Name: {props.name}</h2>
			<h3>Age: {props.age}</h3>
			<h3>Grand Slams: {props.grandSlams}</h3>
		</div>
	)
}

export default ProfessionalPlayersList;
